import React, { useState } from 'react';
import {
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  CssBaseline,
  Container,
  Typography,
} from '@mui/material';
import { Inbox as InboxIcon, Mail as MailIcon } from '@mui/icons-material';

function App() {
  const [navOpen, setNavOpen] = useState(false);
  const [userOpen, setUserOpen] = useState(false);

  const toggleNavDrawer = () => {
    setNavOpen(!navOpen);
  };

  const toggleUserDrawer = () => {
    setUserOpen(!userOpen);
  };

  return (
    <div>
      <CssBaseline />
      <Drawer anchor="left" open={navOpen} onClose={toggleNavDrawer} sx={{ background: '#151515' }}>
        <List>
          <ListItem button>
            <ListItemIcon>
              <InboxIcon />
            </ListItemIcon>
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <MailIcon />
            </ListItemIcon>
          </ListItem>
        </List>
      </Drawer>
      <Drawer anchor="right" open={userOpen} onClose={toggleUserDrawer} sx={{ background: '#151515' }}>
        <List>
          <ListItem>
            <Typography variant="h6" style={{ color: 'white', textAlign: 'center' }}>
              User Name
            </Typography>
          </ListItem>
          <ListItem button>
            <ListItemText primary="Live" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="Sequence" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="Layout" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="More" />
          </ListItem>
        </List>
      </Drawer>
      <div>
        <Container maxWidth="xl" style={{ backgroundColor: '#111115', minHeight: '100vh' }}>
          <button onClick={toggleNavDrawer}>Toggle Nav</button>
          <button onClick={toggleUserDrawer}>Toggle User</button>
        </Container>
      </div>
    </div>
  );
}

export default App;
